INSERT INTO `itemtagmedia` VALUES (4,'text/plain','English Tree Fish were only recently discovered and identified in 2014. They were thought to live in the early Cretaceous period, approximately 120 million years ago. Recently however, a postal worker discovered a small colony living comfortably in a small cottage in Chiswick Park, just west of London.  Scientists hypothicize that they could have contunied to live unnoticed if they hadn\'t ordered from Amazon.\r\n\r\nNocturnal hunters, English Tree Fish average about 2 meters (6 ft) from wingtip to wingtip.  With feather-like scales (or scale-like feathers), and 6 inch talons, they are equally at home hunting prey in the air, on land or in the water.  Researchers have concluded that though English Tree Fish will hunt, kill and eat almost anything, they seem to have a preference for prey with names beginning with the letter D, with dolphin, dachshund and dairy farmers leading the list of favorites.\r\n','2016-12-19 19:38:41','2016-12-19 19:38:41',2);
